# https://leetcode.com/problems/substring-with-concatenation-of-all-words/

import pytest
from collections import defaultdict

class EndOfWordMarker:
    def __init__(self, idx:int) -> None:
        self.word_idx = idx
        self.word_count = 0
        
    def __eq__(self, other):
        if not isinstance(other, EndOfWordMarker):
            return False
        return self.word_idx == other.word_idx
    
    def __repr__(self):
        return f"<{EndOfWordMarker.__name__}-{self.word_idx}>"

class Trie:
    def __init__(self, words:list[str]):
        self.root = {}
        self.letters = set()
        self.word_count = len(words)
        for idx, word in enumerate(words):
            node = self.root
            last_node = None
            for letter in word:
                self.letters.add(letter)
                last_node = node
                node = node.setdefault(letter, {})
            marker = last_node[word[-1]]
            if isinstance(marker, dict):
                marker = EndOfWordMarker(idx)
                last_node[word[-1]] = marker
            marker.word_count += 1

        # print(f"Created Trie:\n{self.root}")

class Walker:
    def __init__(self, t:Trie, idx:int) -> None:
        self.starting_index = idx
        self._finished_word_indices = defaultdict(int)
        self._trie = t
        self._position = t.root

    def step(self, letter):
        # Returns 
        #   True if stepped, 
        #   False if could not step(should stop stepping), 
        #   it's starting index + 1 if successfully finished all words in Trie
        item = self._position.get(letter, None)
        if item is None:
            return False
        if isinstance(item, EndOfWordMarker):
            self._finished_word_indices[item.word_idx] += 1
            if item.word_count < self._finished_word_indices[item.word_idx]:
                return False
            finished_words_count = sum([v for v in self._finished_word_indices.values()])
            # print(f"{self} finished {finished_words_count}/{self._trie.word_count} words")
            if finished_words_count == self._trie.word_count:
                return self.starting_index + 1
            self._position = self._trie.root
        else:
            self._position = item
        return True
    
    def __repr__(self):
        return f"<Walker-{self.starting_index}"

class Solution:
    def findSubstring(self, s: str, words: list[str]) -> list[int]:
        # foreach index in s check if it starts a string from words
        if not words:
            return []
        word_len = len(words[0])
        substr_len = word_len * len(words)
        if len(s)< substr_len:
            return []
        t = Trie(words)
        s_letters = set(s)
        if not t.letters.issubset(s_letters):
            return []
        # handle signle letter quickly
        if len(s_letters) == 1:
            if s[0] * word_len in words:
                return range(len(s) - substr_len + 1)
        ret_indices = []
        walkers = []
        for idx, letter in enumerate(s):
            if len(s) - idx >= substr_len:
                walkers.append(Walker(t, idx))
            valid_walkers = []
            # print(f"Processing letter '{letter}' with {len(walkers)} walkers")
            for walker in walkers:
                res = walker.step(letter)
                # print(f"\t{walker} step {letter} reuslt: {res}")
                if not res:
                    continue
                if isinstance(res, bool):
                    valid_walkers.append(walker)
                else:
                    ret_indices.append(res-1)
            walkers = valid_walkers
                
        return ret_indices
                
                
            
        
        


#######################TESTS######################

def compare_dict(a, b):
    if not isinstance(a, dict) or not isinstance(b, dict):
        return a == b
    if set(a.keys()) != set(b.keys()):
        return False
    return all([compare_dict(a[k], b[k]) for k in a])
    

@pytest.mark.parametrize("words,expected", [
    [['abc'], {'a':{'b':{'c':EndOfWordMarker(0)}}}],
    [['abc', 'ced'], {'a':{'b':{'c':EndOfWordMarker(0)}}, 'c':{'e':{'d':EndOfWordMarker(1)}}}],
    [['abc', 'ced', 'cef'], {'a':{'b':{'c':EndOfWordMarker(0)}}, 'c':{'e':{'d':EndOfWordMarker(1), 'f':EndOfWordMarker(2)}}}],
    [['abc', 'ced', 'abd'], {'a':{'b':{'c':EndOfWordMarker(0), 'd':EndOfWordMarker(2)}}, 'c':{'e':{'d':EndOfWordMarker(1)}}}],
    [['abc', 'ced', 'aaa'], {'a':{'b':{'c':EndOfWordMarker(0)}, 'a':{'a':EndOfWordMarker(2)}}, 'c':{'e':{'d':EndOfWordMarker(1)}}}],
])
def test_trie(words, expected):
    t = Trie(words)
    assert compare_dict(t.root, expected)

def test_walker_sanity():
    words = ['abc', 'abd']
    t = Trie(words)
    walker = Walker(t, 0)
    assert walker.step('a') == True
    assert walker.step('b') == True
    assert walker.step('c') == True
    assert walker.step('a') == True
    assert walker.step('b') == True
    assert walker.step('d') == 1

def test_walker_duplicates():
    words = ['abc', 'abc']
    t = Trie(words)
    walker = Walker(t, 0)
    assert walker.step('a') == True
    assert walker.step('b') == True
    assert walker.step('c') == True
    assert walker.step('a') == True
    assert walker.step('b') == True
    assert walker.step('c') == 1

@pytest.mark.parametrize("words, steps, results", [
    [['abc', 'abd'], 'abcabc', [True, True, True, True, True, False]], 
    [['abc', 'abd'], 'd', [False]], 
    [['abc', 'abd'], 'abcd', [True, True, True, False]], 
])
def test_walker_no_path(words, steps, results):
    t = Trie(words)
    w = Walker(t, 2)
    for step, result in zip(steps, results):
        assert w.step(step) == result
    

